import React from 'react';
import Header from './component/headercomponents/header'
import Body from './component/bodycomponents/body'
import './App.css';
document.body.style.overflow = "hidden"

function App() {
  return (
    <div className="App">

      <Header /> 
      <Body /> 
    </div>
  );
}

export default App;
